const Payment = () => {

        const [isOpen,setIsOpen] = useState(false)

        const toggle= () => {
            setIsOpen(!isOpen)
        }

    return (
        <>
        <Sidebar isOpen= {isOpen} toggle={toggle}/>
        <Navbar toggle={toggle} />  
        <PaymentPage></PaymentPage>
        <Footer></Footer>
        </>
    )
}

export default Payment
